import React from 'react'

const Omoss = () => {
    return (
        <div style={{ maxWidth: '400px' }}>
            <h4>Litt om hva vi gjør</h4>
            <p>
                Gidd er en nettside som prøver å gjøre det lettere for kjente og
                ikke så kjente å planlegge aktiviteter. Hos oss kan du opprette
                eller melde deg på aktiviter som du selv ønsker. Vi har et ønske
                om å oppnå et samhold mellom folk som liker å holde seg i
                aktivitet.
            </p>
            <h4>Hvem er vi?</h4>
            <p>
                Mathias Myrold, Håvard Tysland, Ole Løkken, William Forbrigd,
                Lea Grønning, Erling Sletta, Iben Lind Dragesund, Ingebrigt
                Hovind, Håkon Lien
            </p>
        </div>
    );
};

export default Omoss;
